import React from "react";
import "../../styles/Card.css"


function Card(props) {
  return (
    <div className="card img-container" onClick={props.cardClicked} {...props.children}>
      <div className="img-container">
        <img alt={props.name} src={props.image} />
      </div>
    </div>
  );
}

export default Card;
